// src/App.js
import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import RegularUserRegister from './components/RegularUserRegister';
import BusinessUserRegister from './components/BusinessUserRegister';

function App() {
  return (
    <Router>
      <div className="App">
        <Switch>
          <Route path="/register/regular" component={RegularUserRegister} />
          <Route path="/register/business" component={BusinessUserRegister} />
        </Switch>
      </div>
    </Router>
  );
}

export default App;
